import React,{Component} from 'react'
import {Link} from 'react-router-dom'
import '../estilos/informacion.css'

class Texto extends Component{
    render(){
        return(
            <div className="caja">
                <h1>informacion de la pagina</h1>
            </div>
        )
    }
}
export default Texto;
